import React from 'react';
import { motion } from 'framer-motion';
import { User, MapPin, Calendar, Mail } from 'lucide-react';

const About: React.FC = () => {
  const personalInfo = [
    { icon: User, label: 'Ad Soyad', value: 'Hüseyin Koç' },
    { icon: MapPin, label: 'Konum', value: 'İzmir, Türkiye' },
    { icon: Calendar, label: 'Doğum Tarihi', value: '05/09/2003' },
    { icon: Mail, label: 'Email', value: 'kochuseyin@hotmail.fr' },
  ];

  return (
    <section id="about" className="py-20 relative">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold gradient-text mb-4">
            Hakkımda
          </h2>
          <p className="text-xl text-gray-400 max-w-2xl mx-auto">
            Tutkulu bir yazılım geliştirici olarak modern teknolojilerle çalışmayı seviyorum
          </p>
        </motion.div>

        <div className="grid lg:grid-cols-2 gap-12 items-center">
          {/* Personal Info */}
          <motion.div
            initial={{ opacity: 0, x: -50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
            className="space-y-6"
          >
            <h3 className="text-2xl font-semibold text-white mb-6">
              Kişisel Bilgiler
            </h3>
            <div className="space-y-4">
              {personalInfo.map((info, index) => (
                <motion.div
                  key={info.label}
                  initial={{ opacity: 0, x: -20 }}
                  whileInView={{ opacity: 1, x: 0 }}
                  transition={{ delay: index * 0.1 }}
                  viewport={{ once: true }}
                  className="flex items-center space-x-4 p-4 glass-effect rounded-lg"
                >
                  <info.icon className="text-primary-400" size={20} />
                  <div>
                    <p className="text-gray-400 text-sm">{info.label}</p>
                    <p className="text-white font-medium">{info.value}</p>
                  </div>
                </motion.div>
              ))}
            </div>
          </motion.div>

          {/* About Text */}
          <motion.div
            initial={{ opacity: 0, x: 50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
            className="space-y-6"
          >
            <h3 className="text-2xl font-semibold text-white mb-6">
              Ben Kimim?
            </h3>
            <div className="space-y-4 text-gray-300 leading-relaxed">
              <p>
                Ege Üniversitesi'nde Bilgisayar Mühendisliği 4. sınıf öğrencisiyim. Teknolojiye ve 
                bilgisayar dünyasına duyduğum tutkuyla eğitimime devam ediyor ve kendimi sürekli 
                geliştirmek için çaba sarf ediyorum.
              </p>
              <p>
                İleriki kariyer hedefim, yazılım geliştirme alanında uzmanlaşmak ve teknolojinin 
                sunduğu imkanları en iyi şekilde değerlendirerek yenilikçi çözümler üretmektir. 
                Kendimi sürekli yenilemeyi, öğrenmeyi ve geliştirmeyi prensip edindim.
              </p>
              <p>
                Bu tutku ve kararlılıkla, gelecekte teknoloji dünyasında önemli bir rol oynamayı 
                hedefliyorum. Python, C#, Java, MySQL, Oracle DB gibi teknolojilerde deneyimim var.
              </p>
            </div>

            {/* Stats */}
            <div className="grid grid-cols-3 gap-4 pt-6">
                          {[
              { number: '4', label: 'Sınıf' },
              { number: '3+', label: 'Teknoloji' },
              { number: '100%', label: 'Öğrenme Azmi' },
            ].map((stat, index) => (
                <motion.div
                  key={stat.label}
                  initial={{ opacity: 0, scale: 0.8 }}
                  whileInView={{ opacity: 1, scale: 1 }}
                  transition={{ delay: index * 0.1 }}
                  viewport={{ once: true }}
                  className="text-center p-4 glass-effect rounded-lg"
                >
                  <div className="text-2xl font-bold gradient-text">{stat.number}</div>
                  <div className="text-sm text-gray-400">{stat.label}</div>
                </motion.div>
              ))}
            </div>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default About;
